import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import Category from "./Components/Category";
import NavigationBar from "./Components/NavigationBar";

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Category />
    </div>
  );
}

export default App;
